import React from 'react';
import './App.css';

const key = process.env.APCA_API_KEY_ID;
const secret = process.env.APCA_API_SECRET_KEY
function App() {
    function name() {
        var myHeaders = new Headers();
        myHeaders.append("APCA-API-KEY-ID", "PKJW2Q4804K5CRVQL66L");
        myHeaders.append("APCA-API-SECRET-KEY", "HMAJGMWrIExCx3J0kjB4wQzSrH4WYtjmPh75tbph");

        var requestOptions = {
            method: 'GET',
            headers: myHeaders,
            redirect: 'follow'
        };

        fetch("https://paper-api.alpaca.markets/v2/account", requestOptions)
            .then(response => response.text())
            .then(result => result.json)
            .catch(error => console.log('error', error));
    }
    return (
        <div id="Title">
            Stock Portfolio
            <div id = "name">
                {name()}
            </div>
        </div>
    );

}

export default App;
